import React from "react";
import { NavLink } from "react-router-dom";
function ShowData(props) {
  return (
    <>
      {props.data.map((value,index) => (
        <div className="card" key={index}>
          <div className="card-body">
            {props.type==="employee"?
            <NavLink to={`/${props.type}/${value.pField2}`}>{value.pField1}</NavLink>:
            <NavLink to={`/${props.type}/${value.pField1}`} className="link-conference">Conference ID-{value.pField1} <b>{value.pField2}</b></NavLink>
            }
          </div>
        </div>
      ))}
    </>
  );
}
export default ShowData;
